import kingsCollectionData from './kingscollectiondata'

export default function KingsCollection({id,title,pricing,alt,image}) {
    return (

        <div>

            <div className='w-[50%] h-full bg-slate-300 kings'><img src={image} alt={alt}/></div>
                <div className='w-[50%] h-full bg-slate-500'><hi>{title }</hi></div>
            </div>
  )
}
